import React from 'react'
import './Link.style.css'
export default function Link({ href , target , rel , text}) {
    return (
        <div>
            <a
          className="App-link"
          href={href}
          target={target}
          rel={rel}
        >
        {text}
                </a>
        </div>
    )
}
